import React from 'react';
import Navigation from './components/navigation/navigation.component';
import Home from './components/home/home.component';
import SignIn from './components/sign-in/sign-in.component';
import './App.css';

function App() {
  return (
    <div className="App">
     <Navigation/>
       <SignIn />
      <Home />
    </div>
  );
}

export default App;
